import UserButton from "./UserButton";
import "./componentStyle.css";

interface Props {
  user: string;
  onButClick: (buttonType: string) => void;
}

const UserChoice = ({ onButClick }: Props) => {
  const handleClick = ({ user }: Props) => {
    onButClick(user);
  };

  return (
    <>
      <main
        className="govuk-main-wrapper app-main-class"
        id="main-content"
        role="main"
      >
        <table className="center">
          <tr>
            <th>
              <UserButton type="Patient" onClick={handleClick("Doctor")} />
            </th>
            <th>
              <UserButton type="Doctor" />
            </th>
            <th>
              <UserButton type="Admin" />
            </th>
          </tr>
        </table>
      </main>
    </>
  );
};

export default UserChoice;
